import React from 'react';
import Card from '../UI/Card';
import './style.css';

const Sidebar=props=>{
    return(
        <div className="sidebarContainer">
        <Card style={{width:'70%'}}>
        My First Blog
        </Card>
        </div>

       
    );
}

export default Sidebar;
